import React from 'react'
import "./Navbar.css"
import Logo from "./CoralLogo"
const Navbar = () => {
  return (
    <div className='navbar'>
        <div className='navContainer'>
            <span className='logo'><img src={Logo} alt='logo'/></span>
        </div>
    </div>
  )
}

export default Navbar
